fn main() {
    let document = web_sys::window().unwrap().document().unwrap();
    let body = document.body().unwrap();

    let closure: Rc<Closure<dyn Fn()>> = Rc::new_cyclic(move |this: &Weak<Closure<dyn Fn()>>| {
        let this = this.clone();
        Closure::new(move || {
            body.set_inner_text("");
            for str in strings {
                body.append_child(&document.create_text_node(str)).unwrap();
            }

            web_sys::window()
                .unwrap()
                .request_animation_frame((*this.upgrade().unwrap()).as_ref().unchecked_ref())
                .unwrap();
        })
    });

    web_sys::window()
        .unwrap()
        .request_animation_frame(closure.as_ref().as_ref().unchecked_ref())
        .unwrap();

    std::mem::forget(closure);
}
